import Chart from "react-apexcharts";

const Donut = () => {
  return (
    <>
      <Chart
        type="donut"
        series={[23, 80]}
        options={{
          colors: ["#DA1E28", "#2DCD1F"],
          labels: ["Leave", "Working"],
          dataLabels: {
            enabled: true,
            background: {
              enabled: true,
              foreColor: "#fff",
              padding: 4,
              borderRadius: 2,
              borderWidth: 1,
              borderColor: "#fff",
              opacity: 0.9,
              dropShadow: {
                enabled: false,
                top: 1,
                left: 1,
                blur: 1,
                color: "#000",
                opacity: 0.45,
              },
            },
          },
          chart: {
            height: "100%",
            width: "100%",
          },
          legend: {
            show: true,
            position: "bottom",
            horizontalAlign: "center",
            fontSize: "18px",
            markers: {
              width: 12,
              height: 12,
              radius: 12,
              offsetX: 0,
              offsetY: 0,
            },
            itemMargin: {
              horizontal: 5,
              vertical: 0,
            },
          },
        }}
      ></Chart>
    </>
  );
};

export default Donut;
